&lt;p style=&quot;text-align: justify;&quot;&gt;&lsquo;दूरदर्शन&rsquo; के डायरेक्ट टू होम (DTH) प्&zwj;लेटफॉर्म &lsquo;फ्रीडिश&rsquo; से चैनल हटाने का फैसला कई ब्रॉडकास्टर्स को फिलहाल भारी पड़ने लगा है। दरअसल, &lsquo;फ्रीडिश&rsquo; से अपने चैनल्स हटाने के साथ ही इन बॉडकास्टर्स की 20 लाख मिलियन से ज्यादा व्युअरशिप भी कम हो गई है। ऐसे में कई चैनल्स का एड रेवेन्यू काफी घट गया है।&lt;/p&gt;

&lt;p style=&quot;text-align: justify;&quot;&gt;बता दें कि चार प्रमुख ब्रॉडकास्टर्स &lsquo;स्टार इंडिया&rsquo;, &lsquo;ZEEL&rsquo;,&lsquo;सोनी पिक्चर्स नेटवर्क इंडिया&rsquo; और &lsquo;इंडिया कास्ट मीडिया डिस्ट्रीब्यूशन&rsquo; ने इस साल फरवरी में इस प्लेटफॉर्म से अपने चैनल्स हटाने का निर्णय लिया था। &lsquo;इंडिया कास्ट मीडिया डिस्ट्रीब्यूशन&rsquo; ब्रॉडकास्टर्स &#39;टीवी18&#39; और &#39;वायकॉम18&#39; के चैनलों को डिस्ट्रीब्यूट करता है। इंडस्ट्री से जुड़े विशेषज्ञों का अनुमान है कि पहले जो चैनल्स फ्री टू एयर प्रसारित होते थे, वे फ्रीडिश की शहरी व ग्रामीण क्षेत्रों में अच्छी पहुंच के कारण उसका लाभ लेते हुए व्युअरशिप के आधार पर विज्ञापनदाताओं से दस सेकेंड के विज्ञापन के लिए 4000 और 5500 रुपए तक चार्ज करते थे। लेकिन अब यह विज्ञापन दरें काफी घटकर 3000 रुपए प्रति दस सेकेंड तक हो गई हैं, क्योंकि चैनल्स &lsquo;कॉस्ट पर रेटिंग पॉइंट&rsquo; (CPRP) &nbsp;देने में भी असफल हो रहे हैं। &nbsp;&lt;/p&gt;

&lt;p style=&quot;text-align: justify;&quot;&gt;इस बारे में &lsquo;DCMN India&rsquo; के डायरेक्टर (ऑफलाइन मीडिया) सुधीर कुमार का कहना है, &lsquo;कई चैनल्स जो फ्रीडिश से पे चैनल्स बन गए हैं, उनका प्रति सप्ताह &lsquo;ग्रॉस रेटिंग पाइंट&rsquo; (GRP) कम हो गया है। एक बार &lsquo;ग्रॉस रेटिंग पाइंट&rsquo; कम होने पर वे उन रेट पर विज्ञापन नहीं मांग सकते हैं, जिन पर छह महीने पहले मांगते थे। फ्रीडिश से हटने के कारण जनरल एंटरटेनमेंट चैनल्स (GEC) की व्युअरशिप भी 60 से 80 प्रतिशत तक घट गई है।&rsquo;&lt;/p&gt;&lt;script async src=&quot;//pagead2.googlesyndication.com/pagead/js/adsbygoogle.js&quot;&gt;&lt;/script&gt;
