&lt;p style=&quot;text-align: justify;&quot;&gt;इसके साथ ही यह भी कहा जा रहा है कि प्राइवेट ब्रॉडकास्टर जो डीडी-फ्रीडिश को हर साल छह से आठ करोड़ रुपए का भुगतान कर रहे थे, वे हर साल 500 से 700 करोड़ रुपए की कमाई कर रहे थे। फ्रीडिश से हटने के बाद ऐसे कई चैनल्स का रेवेन्यू 200 करोड़ रुपए से भी कम हो गया है। &nbsp;&lt;/p&gt;

&lt;p style=&quot;text-align: justify;&quot;&gt;&lsquo;ट्राई&rsquo; (TRAI) के नए टैरिफ ऑर्डर लागू होने के बाद फ्रीडिश प्लेटफॉर्म से हिंदी के बड़े एंटरटेनमेंट चैनल्स हटाने पर हुए उन्हें हुए रेवेन्यू के नुकसान की बात करें तो &lsquo;जी मीडिया कॉरपोरेशन लिमिटेड&rsquo; (Zee Media Corporation Limited) ने वित्तीय वर्ष 2019 की चौथी तिमाही में समेकित (consolidated) रेवेन्यू 1693.50 मिलियन रुपए और पूरे 2018-19 के लिए 6869.2 मिलियन रुपए बताया था। वित्तीय वर्ष 2018 में जहां ऑपरेटिंग रेवेन्यू 5734.8 मिलियन रुपए था, वह वित्तीय वर्ष 2019 में 19.8 प्रतिशत बढ़कर 6869.20 मिलियन रुपए रहा।&lt;/p&gt;

&lt;p style=&quot;text-align: justify;&quot;&gt;हालांकि, वित्तीय वर्ष 2019 की चौथी तिमाही में ऑपरेटिंग रेवेन्यू में 3.9 प्रतिशत की गिरावट आई और वित्तीय वर्ष 2018 की चौथी तिमाही में 1762.2 मिलियन रुपए के मुकाबले यह 1693.5 मिलियन रुपए रह गया। इस बारे में &lsquo;जी&rsquo; का कहना था कि रेवेन्यू में मुख्य रूप से गिरावट ट्राई के नए टैरिफ ऑर्डर को देखते हुए एडवर्टाइजर्स द्वारा विज्ञापन खर्च में कमी के कारण रही। सिर्फ &lsquo;जी&rsquo; ही एक उदाहरण नहीं है, ऐसे कई चैनल्स हैं, जिनके रेवेन्यू में इस प्रक्रिया के दौरान कमी आई है।&lt;/p&gt;&lt;script async src=&quot;//pagead2.googlesyndication.com/pagead/js/adsbygoogle.js&quot;&gt;&lt;/script&gt;
