&lt;p style=&quot;text-align: justify;&quot;&gt;इन फ्री टू एयर चैनल्स से अपने विज्ञापन हटाने के बाद माना जा रहा है कि एडवर्टाइजर्स ने निवेश के अन्य रास्ते तलाश लिए हैं। इस बारे में &lsquo;इमामी&rsquo; (Emami) के सीनियर वाइस प्रेजिडेंट (मीडिया) बासब सरकार का कहना है कि इमामी जैसे एडवर्टाइजर्स के लिए यह काफी फायदे का सौदा रहा, जिसका फोकस ग्रामीण क्षेत्रों पर था। इसका कारण बताते हुए बासब सरकार ने कहा, देश में चुनाव और अन्य बड़े मुद्दों के कारण हिंदी न्यूज चैनल्स की व्युअरशिप काफी बढ़ गई थी, जिससे उनके एडवर्टाइजिंग रेवेन्यू में काफी इजाफा हुआ।&rsquo;&lt;/p&gt;

&lt;p style=&quot;text-align: justify;&quot;&gt;हालांकि, यह स्थिति यूं ही बनी रहेगी अथवा इसमें बदलाव होगा, इस बारे में फिलहाल कुछ भी स्पष्ट नहीं है। विशेषज्ञों का कहना है कि नुकसान जरूर हुआ है, लेकिन यह स्थिति यूं ही नहीं बनी रहेगी। इस बारे में &lsquo;सब&rsquo; (SAB) ग्रुप के सीईओ मानव ढांडा का कहना है, &lsquo;जिन चार बड़े ब्रॉडकास्टर्स ने फ्रीडिश से अपने चैनल हटाने का फैसला लिया है, उनके पास और भी कई चैनल्स हैं। ऐसे में यदि उन्हें किसी एक चैनल से नुकसान होता है तो वे दूसरे चैनल्स से इस नुकसान की भरपाई कर सकते हैं। यह नुकसान थोड़े समय के लिए ही है, आने वाले समय में यह ब्रॉडकास्टर्स और डीटीएच प्रोवाइडर्स दोनों के लिए फायदेमंद होगा।&rsquo;&lt;/p&gt;

